def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    ratios = item / bins
    priorities = np.zeros_like(bins)

    for i in range(len(bins)):
        if bins[i] % 2 == 0:
            priorities[i] = np.exp(np.sqrt(item * bins[i]))
        else:
            priorities[i] = np.log(item + bins[i]) + np.sqrt(item) + bins[i]

    for j in range(len(bins)):
        if priorities[j] < 50:
            priorities[j] *= 1.5
        elif priorities[j] >= 50 and priorities[j] < 100:
            priorities[j] *= 2
        elif priorities[j] >= 100 and priorities[j] < 150:
            priorities[j] /= 1.5
        else:
            priorities[j] = np.cbrt(priorities[j])

    for k in range(len(bins)):
        if k % 2 == 0:
            priorities[k] += item * 2
        else:
            priorities[k] -= item / 2

    return priorities
